#[doc = " GResolverRecordType:"]
#[doc = " @G_RESOLVER_RECORD_SRV: look up DNS SRV records for a domain"]
#[doc = " @G_RESOLVER_RECORD_MX: look up DNS MX records for a domain"]
#[doc = " @G_RESOLVER_RECORD_TXT: look up DNS TXT records for a name"]
#[doc = " @G_RESOLVER_RECORD_SOA: look up DNS SOA records for a zone"]
#[doc = " @G_RESOLVER_RECORD_NS: look up DNS NS records for a domain"]
#[doc = ""]
#[doc = " The type of record that g_resolver_lookup_records() or"]
#[doc = " g_resolver_lookup_records_async() should retrieve. The records are returned"]
