#[doc = " the variant tuples returned."]
#[doc = ""]
#[doc = " %G_RESOLVER_RECORD_SRV records are returned as variants with the signature"]
#[doc = " `(qqqs)`, containing a `guint16` with the priority, a `guint16` with the"]
#[doc = " weight, a `guint16` with the port, and a string of the hostname."]
#[doc = ""]
#[doc = " %G_RESOLVER_RECORD_MX records are returned as variants with the signature"]
#[doc = " `(qs)`, representing a `guint16` with the preference, and a string containing"]
#[doc = " the mail exchanger hostname."]
#[doc = ""]
#[doc = " %G_RESOLVER_RECORD_TXT records are returned as variants with the signature"]
#[doc = " `(as)`, representing an array of the strings in the text record. Note: Most TXT"]
#[doc = " records only contain a single string, but"]
#[doc = " [RFC 1035](https://tools.ietf.org/html/rfc1035#section-3.3.14) does allow a"]
#[doc = " record to contain multiple strings. The RFC which defines the interpretation"]
#[doc = " of a specific TXT record will likely require concatenation of multiple"]
#[doc = " strings if they are present, as with"]
#[doc = " [RFC 7208](https://tools.ietf.org/html/rfc7208#section-3.3)."]
#[doc = ""]
#[doc = " %G_RESOLVER_RECORD_SOA records are returned as variants with the signature"]
#[doc = " `(ssuuuuu)`, representing a string containing the primary name server, a"]
#[doc = " string containing the administrator, the serial as a `guint32`, the refresh"]
#[doc = " interval as a `guint32`, the retry interval as a `guint32`, the expire timeout"]
#[doc = " as a `guint32`, and the TTL as a `guint32`."]
#[doc = ""]
#[doc = " %G_RESOLVER_RECORD_NS records are returned as variants with the signature"]
#[doc = " `(s)`, representing a string of the hostname of the name server."]
